                                            <h3>{nickname}</h3>
                                            <button className="button" onClick={() => releasepokemon(name)}>Release</button>
                                        </center>
                                    </div>
              );
                            }) : null
                        }
                    </React.Fragment>
                )}
            </PokemonConsumer>
        );
    }
}

export default MyPokemon;
